    [],nt"num_tags": 10,nt"name": "natural-ecological-processes-affecting-the-nulhegan-basin",nt"isopen":
    false,nt"url": null,nt"notes": "This report is a summary of current understanding
    of the environmental forces which were responsible for the natural vegetation patterns
    in northeastem Vermont. This history focuses on the lands and sources relevant to
    Nulhegan and Paul Stream drainages, specifically 48,000 acres in the towns of Lewis,
    Ferdinand, Bloomfield, Brunswick, and Maidstone acquired from Champion International
    in 2000.  These lands are now managed by the Nulhegan Basin Division of the Silvio
    O. Conte National Fish and Wildlife Refuge and the West Mountain Wildlife Management
    Area of the State of Vermont.  Essentially this is a region-specific review of ecological
    processes which cause-disturbance to the forest and as far as possible, an attempt
    to assess the quantitative importance of each of them.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
